import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { CallService } from '../../services/call.service';
import { Observable } from 'rxjs';

@Component({
  selector: 'app-call-controls',
  templateUrl: './call-controls.component.html',
  styleUrls: ['./call-controls.component.scss']
})
export class CallControlsComponent implements OnInit {
  callState$: Observable<any>;

  constructor(
    private callService: CallService,
    private router: Router
  ) {
    this.callState$ = this.callService.getCallState();
  }

  ngOnInit() {}

  async toggleAudio() {
    try {
      await this.callService.toggleAudio();
    } catch (error) {
      console.error('Failed to toggle audio:', error);
    }
  }

  async toggleVideo() {
    try {
      await this.callService.toggleVideo();
    } catch (error) {
      console.error('Failed to toggle video:', error);
    }
  }

  async switchCamera() {
    try {
      await this.callService.switchCamera();
    } catch (error) {
      console.error('Failed to switch camera:', error);
    }
  }

  async toggleScreenShare() {
    try {
      await this.callService.toggleScreenShare();
    } catch (error) {
      console.error('Failed to toggle screen share:', error);
    }
  }

  async endCall() {
    try {
      await this.callService.endCall();
      this.router.navigate(['/home']);
    } catch (error) {
      console.error('Failed to end call:', error);
    }
  }
}
